class Pixa{
  late int total;
  late int totalHits;
  late List<Hits> hits;

  Pixa({required this.total, required this.totalHits, required this.hits});

  Pixa.fromJson(dynamic jjj) {
    total = jjj['total'];
    totalHits = jjj['totalHits'];
    if (jjj['hits'] != null) {
      hits = [];
      jjj['hits'].forEach((v) {
        hits.add(Hits.fromJson(v));
      });
    }
  }

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['total'] = total;
    map['totalHits'] =totalHits;
    map['hits'] = hits.map((v) => v.toJson()).toList();

    return map;
  }
}

class Hits{
  late int id;
  late String previewURL;
  late String tags;
  Hits(this.id, this.previewURL, this.tags);

  @override
  String toString() {
    return 'Hits{id:$id,  pageURL:$previewURL, type:$tags}';
  }

  Hits.fromJson(dynamic jjj) {
    id = jjj['id'];
    previewURL = jjj['previewURL'];
    tags = jjj['tags'];
  }

  Map<String, dynamic>? toJson() {
    final map = <String, dynamic>{};
    map['id'] = id;
    map['previewURL'] = previewURL;
    map['tags'] = tags;
  }
}







